webpackJsonp([0xcc7b9b04168b],{283:function(e,o){e.exports={data:{markdownRemark:{html:'<h3>Reading</h3>\n<ul>\n<li>(Optional) <a href="https://www.html5rocks.com/en/tutorials/audio/scheduling/">A Tale of Two Clocks - Scheduling Web Audio with Precision</a></li>\n</ul>\n<h3>Assignments</h3>\n<h4>Listen</h4>\n<blockquote>\n<p>Find one or more examples of one of the elements of rhythm, and add it to our <a href="https://github.com/luisaph/the-code-of-music-2018/wiki/Collaborative-Playlist">collaborative playlist</a> page under Rhythm.</p>\n</blockquote>\n<h4>Interact</h4>\n<blockquote>\n<p>Pick two <a href="https://github.com/luisaph/the-code-of-music-2018/wiki/Examples">rhythm project examples</a>. Write a short response.</p>\n</blockquote>\n<h4>Design</h4>\n<blockquote>\n<p>Focusing on one or more of the concepts covered in class, sketch an interface to explore/compose with rhythm. Consider different contexts, materials, users, spacesâ€”don\'t limit yourself to what you know how to implement.</p>\n</blockquote>\n<h4>Code</h4>\n<blockquote>\n<p>Explore and tinker with the <a href="https://luisaph.github.io/the-code-of-music-2018/#Rhythm">examples above</a> (from \'change the tempo\' onwards). Then, create a rhythmic sketch/composition.</p>\n</blockquote>',frontmatter:{date:"21 September, 2018",title:"Week 2 rhythm"},fields:{slug:"/blog/itp/code-of-music/rhythm/"}}},pathContext:{slug:"/blog/itp/code-of-music/rhythm/"}}}});
